eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   TURISMO: () => (/* binding */ TURISMO)\n/* harmony export */ });\nconst TURISMO = [\n    {\n        id: 'parque-natural-de-corralejo',\n        title: 'Parque Natural de Corralejo',\n        summary: 'Imponentes dunas doradas junto al Atlntico, con kilmetros de playas.',\n        heroImage: 'images/turismo/corralejo-dunas.jpg',\n        gallery: [\n            'images/turismo/corralejo-dunas.jpg',\n            'images/turismo/isla-de-lobos.jpg',\n            'images/turismo/popcorn-beach.jpg'\n        ],\n        placeQuery: 'Parque Natural de Corralejo, Fuerteventura',\n        lat: 28.7189,\n        lng: -13.8346,\n        features: [\n            'Naturaleza',\n            'Dunas',\n            'Fcil acceso'\n        ],\n        description: 'Explora las impresionantes dunas de arena dorada y las vistas al mar cristalino en uno de los parques naturales ms emblemticos de la isla. Las Grandes Playas se extienden por kilmetros junto al azul turquesa del Atlntico. Recomendacin: visita al amanecer o al atardecer para disfrutar de luz suave y menos viento; aparcamiento sealizado a lo largo de la FV-1.',\n        history: 'El sistema dunar de Corralejo se form por la accin combinada del viento y el mar, modelando arenas claras de origen marino que avanzan lentamente hacia el interior. Su valor ecolgico y paisajstico ha motivado su proteccin como espacio natural, salvaguardando hbitats costeros y especies adaptadas al viento y la aridez. El cercano pueblo de Corralejo creci de la pesca y, ms tarde, del turismo ligado a sus playas y al embarque hacia Lobos y Lanzarote.',\n        longDescription: 'El parque rene playas abiertas, campos de dunas mviles y zonas de matorral costero. Caminar por las crestas al amanecer permite disfrutar de texturas y sombras nicas, mientras que al atardecer el viento suele ser ms suave. Es un entorno sin sombra ni servicios: lleva agua, proteccin solar y respeta senderos marcados para no daar la vegetacin. Desde algunos puntos se divisan Lobos y Lanzarote; en das claros, el horizonte es inabarcable.',\n        info: {\n            bestTime: 'Amanecer y atardecer; menos viento en primeras/ltimas horas',\n            parking: 'Aparcamientos sealizados a lo largo de la FV-1',\n            accessibility: 'Terreno arenoso; accesos a playa sin sombra',\n            services: 'Sin servicios directos en dunas; ocio y restauracin en Corralejo',\n            duration: '1,53 horas (paseo + playa)',\n            difficulty: 'Baja (arena blanda)',\n            tips: 'Lleva agua y proteccin solar; no salgas de senderos marcados'\n        }\n    },\n    {\n        id: 'betancuria',\n        title: 'Betancuria',\n        summary: 'Antigua capital, arquitectura tradicional y museos en un valle histrico.',\n        heroImage: 'images/turismo/betancuria.jpg',\n        gallery: [\n            'images/turismo/betancuria.jpg',\n            'images/turismo/mirador-morro-velosa.jpg',\n            'images/turismo/molino-antigua.jpg'\n        ],\n        placeQuery: 'Betancuria, Fuerteventura',\n        lat: 28.4230,\n        lng: -14.0561,\n        features: [\n            'Historia',\n            'Museo',\n            'Mirador'\n        ],\n        description: 'Visita la antigua capital de Fuerteventura, un pueblo histrico con arquitectura tradicional y museos. Recorre sus calles empedradas, la iglesia de Santa Mara y los miradores cercanos. Hay restaurantes con cocina local y aparcamiento municipal en el centro.',\n        history: 'Betancuria fue fundada por colonos europeos y desempe durante siglos un papel administrativo y religioso clave en la isla. El valle ofreca abrigo frente a los vientos y favoreca pequeas zonas de cultivo y pastoreo. A lo largo del tiempo, reconstrucciones y reformas dejaron huella en templos y edificios civiles, hoy testimonio de la historia majorera.',\n        longDescription: 'El conjunto histrico conserva casas encaladas, patios y calles que invitan a pasear sin prisa. La iglesia de Santa Mara, los pequeos museos y los miradores de los alrededores trazan una ruta perfecta para medio da. Disfruta la gastronoma local (quesos, cabrito, mojos) y detente en el valle para observar el paisaje interior. Aparca en las zonas habilitadas y camina el centro a pie para apreciar sus detalles.',\n        info: {\n            bestTime: 'Maanas templadas; evita medioda en verano',\n            parking: 'Aparcamiento municipal en el centro del pueblo',\n            accessibility: 'Centro llano; calles empedradas en algunos tramos',\n            services: 'Restaurantes, cafeteras y pequeos museos',\n            duration: '23 horas',\n            difficulty: 'Baja',\n            tips: 'Combina con miradores cercanos (Morro Velosa)'\n        }\n    },\n    {\n        id: 'faro-de-morro-jable',\n        title: 'Faro de Morro Jable',\n        summary: 'Atardeceres memorables en el sur con paseo martimo y playa de Janda.',\n        heroImage: 'images/turismo/faro-morro-jable.jpg',\n        gallery: [\n            'images/turismo/faro-morro-jable.jpg',\n            'images/turismo/parque-natural-jandia.jpg',\n            'images/turismo/punta-pesebre.jpg'\n        ],\n        placeQuery: 'Faro de Morro Jable, Fuerteventura',\n        lat: 28.0498,\n        lng: -14.3406,\n        features: [\n            'Atardecer',\n            'Faro',\n            'Paseo martimo'\n        ],\n        description: 'Contempla las mejores puestas de sol de la isla desde este faro icnico junto a la playa de Janda. Acceso a pie por el paseo martimo, con bares y tiendas en las cercanas. Ideal para familias y fotografa.',\n        history: 'El litoral de Morro Jable pas de enclave pesquero a destino turstico, integrando el faro como referencia visual del paseo. La franja costera y el sistema dunar cercano muestran la dinmica entre viento, mareas y vegetacin litoral, hoy compatibilizada con uso recreativo.',\n        longDescription: 'Durante el da, la playa ofrece aguas tranquilas y un amplio arenal; al caer la tarde, el cielo y el ocano se tien de dorados. El paseo est salpicado de cafeteras, comercios y zonas de descanso. Es un recorrido accesible y llano, perfecto para familias y personas mayores. Lleva una chaqueta ligera por la brisa vespertina y disfruta del ocaso desde los bancos frente al faro.',\n        info: {\n            bestTime: 'Atardecer',\n            parking: 'Aparcamientos en zona urbana de Morro Jable',\n            accessibility: 'Paseo llano y accesible; bancos y sombras puntuales',\n            services: 'Tiendas, bares y restaurantes junto al paseo',\n            duration: '12 horas (paseo + ocaso)',\n            difficulty: 'Baja',\n            tips: 'Lleva prenda ligera por brisa; buen punto fotogrfico'\n        }\n    },\n    {\n        id: 'isla-de-lobos',\n        title: 'Isla de Lobos',\n        summary: 'Reserva natural para senderismo y snorkel a 15 minutos de Corralejo.',\n        heroImage: 'images/turismo/isla-de-lobos.jpg',\n        gallery: [\n            'images/turismo/isla-de-lobos.jpg',\n            'images/turismo/corralejo-dunas.jpg'\n        ],\n        placeQuery: 'Isla de Lobos, Fuerteventura',\n        lat: 28.7436,\n        lng: -13.8266,\n        features: [\n            'Senderismo',\n            'Snorkel',\n            'Reserva'\n        ],\n        description: 'Descubre este paraso natural con senderos volcnicos y aguas cristalinas. Es necesaria reserva de permiso con antelacin y el acceso se realiza en barco desde Corralejo. Lleva agua, proteccin solar y respeta los itinerarios sealizados.',\n        history: 'La pequea isla debe su nombre a las focas monje que habitaron sus costas. Su faro y el casero tradicional reflejan la relacin entre mar y subsistencia en un enclave aislado. La declaracin de proteccin limita aforos y usos para conservar sus hbitats y tranquilidad.',\n        longDescription: 'El sendero principal bordea parajes volcnicos y saladares; el Puertito y la playa de La Concha son puntos perfectos para descansar y nadar cuando el mar lo permite. No hay sombra ni servicios estables, as que planifica agua y comida. Respeta la sealizacin, no salgas de los caminos y verifica horarios del barco de regreso.',\n        info: {\n            bestTime: 'Maana; consultar mareas para bao',\n            parking: 'Aparca en Corralejo y toma barco a Lobos',\n            accessibility: 'Senderos irregulares; no recomendado con movilidad reducida',\n            services: 'Servicios limitados; lleva agua y comida',\n            duration: '35 horas (ruta + bao)',\n            difficulty: 'Bajamedia',\n            tips: 'Reserva permiso con antelacin y revisa horarios de barco'\n        }\n    },\n    {\n        id: 'el-cotillo',\n        title: 'El Cotillo',\n        summary: 'Pueblo pesquero con lagunas y restaurantes de pescado fresco.',\n        heroImage: 'images/turismo/el-cotillo.avif',\n        gallery: [\n            'images/turismo/el-cotillo.avif',\n            'images/turismo/popcorn-beach.jpg'\n        ],\n        placeQuery: 'El Cotillo, Fuerteventura',\n        lat: 28.6827,\n        lng: -14.0133,\n        features: [\n            'Pescado fresco'\n        ],\n        description: 'Encanto marinero, lagunas de aguas turquesas y puestas de sol espectaculares. Ideal para familias por sus calas protegidas. Gastronoma con pescado local y terrazas frente al mar.',\n        history: 'El Cotillo creci alrededor de la pesca artesanal y del pequeo puerto, expandindose con el turismo gracias a sus lagunas resguardadas y su carcter tranquilo. La presencia de antiguas defensas y caminos costeros recuerda su pasado marinero y la importancia del litoral.',\n        longDescription: 'Las lagunas al norte ofrecen aguas calmadas, estupendas para darse un bao con nios. En el ncleo, restaurantes y bares sirven pescado del da y tapas canarias. Al atardecer, el cielo suele regalar tonos intensos sobre el mar. Aparca en reas designadas y camina por el paseo y las calas cercanas.',\n        info: {\n            bestTime: 'Tarde y ocaso; maanas para bao en lagunas',\n            parking: 'Zonas de aparcamiento en el ncleo y cercanas',\n            accessibility: 'Paseos llanos; accesos variables a calas',\n            services: 'Restaurantes y bares frente al mar',\n            duration: '24 horas',\n            difficulty: 'Baja',\n            tips: 'Comprueba viento; protege equipo de arena'\n        }\n    },\n    {\n        id: 'playa-de-cofete',\n        title: 'Playa de Cofete',\n        summary: 'Playa salvaje rodeada de montaas. Acceso por pista. Vistas picas.',\n        heroImage: 'images/turismo/cofete.jpg',\n        gallery: [\n            'images/turismo/cofete.jpg',\n            'images/turismo/parque-natural-jandia.jpg',\n            'images/turismo/punta-pesebre.jpg'\n        ],\n        placeQuery: 'Playa de Cofete, Fuerteventura',\n        lat: 28.1083,\n        lng: -14.3845,\n        features: [\n            'Naturaleza salvaje',\n            'Fotografa',\n            '4x4 recomendado'\n        ],\n        description: 'Una de las playas ms vrgenes de Canarias, con arena dorada y un entorno montaoso impresionante. Acceso por pista de tierra; conducir con precaucin. No hay servicios, lleva agua y comida. Mejor evitar das de viento fuerte.',\n        history: 'El aislamiento de Cofete ha preservado su carcter salvaje. Entre el macizo montaoso y el ocano se extiende un paisaje de arenas y nieblas costeras. La zona ha inspirado relatos y fotografas por su atmsfera remota e imponente.',\n        longDescription: 'El trayecto por pista exige prudencia y tiempo; consulta el estado antes de salir. En la playa no hay sombra ni chiringuitos, por lo que conviene planificar vveres y vestimenta. La amplitud del arenal y el oleaje resaltan en das despejados; en condiciones de viento fuerte, limita la estancia.',\n        info: {\n            bestTime: 'Maana con poco viento',\n            parking: 'Zonas informales al final de la pista',\n            accessibility: 'Acceso por pista; no apto para carritos/sillas',\n            services: 'Sin servicios en playa',\n            duration: '35 horas (trayecto + estancia)',\n            difficulty: 'Media (pista de tierra)',\n            tips: 'Lleva vveres y revisa el parte de viento'\n        }\n    },\n    {\n        id: 'cuevas-de-ajuy',\n        title: 'Cuevas de Ajuy',\n        summary: 'Cuevas marinas y acantilados volcnicos, sendero costero sealizado.',\n        heroImage: 'images/turismo/ajuy.webp',\n        gallery: [\n            'images/turismo/ajuy.webp',\n            'images/turismo/punta-pesebre.jpg'\n        ],\n        placeQuery: 'Cuevas de Ajuy, Fuerteventura',\n        lat: 28.3996,\n        lng: -14.1611,\n        features: [\n            'Geologa',\n            'Cuevas marinas',\n            'Sendero'\n        ],\n        description: 'Formaciones geolgicas milenarias creadas por la erosin del ocano. Sendero con barandillas y miradores; calzado cmodo recomendado. En el pueblo hay restaurantes y aparcamiento.',\n        history: 'La costa oeste muestra acantilados y estratos que cuentan la historia volcnica de la isla. El trabajo del mar labr cavidades y arcos donde hoy se aprecia la fuerza del oleaje. Ajuy conserva el ambiente marinero y el vnculo con antiguas rutas costeras.',\n        longDescription: 'El itinerario sealizado asciende entre roca y muretes hasta miradores naturales sobre el ocano. Evita acercarte a bordes expuestos con mar de fondo o viento. Tras el paseo, el pequeo ncleo ofrece cocina local y descanso frente a la playa de arena oscura.',\n        info: {\n            bestTime: 'Maana o tarde sin mar de fondo',\n            parking: 'Aparcamiento en el ncleo de Ajuy',\n            accessibility: 'Sendero con escalones y barandillas; no accesible',\n            services: 'Restaurantes junto a la playa',\n            duration: '1,53 horas',\n            difficulty: 'Bajamedia',\n            tips: 'Calzado cmodo; precaucin con viento en miradores'\n        }\n    },\n    {\n        id: 'la-oliva',\n        title: 'La Oliva',\n        summary: 'Villa histrica con iglesia y Casa de los Coroneles.',\n        heroImage: 'images/turismo/la-oliva.avif',\n        gallery: [\n            'images/turismo/la-oliva.avif',\n            'images/turismo/betancuria.jpg'\n        ],\n        placeQuery: 'La Oliva, Fuerteventura',\n        lat: 28.6100,\n        lng: -13.9286,\n        features: [\n            'Patrimonio',\n            'Arquitectura',\n            'Centro de arte'\n        ],\n        description: 'Historia y patrimonio majorero en un entorno tradicional. Visita la iglesia de Nuestra Seora de la Candelaria y la Casa de los Coroneles. Aparcamiento en calles adyacentes.',\n        history: 'La Oliva fue sede de mandos militares y administrativos en diferentes etapas, lo que dej un legado singular de arquitectura civil y religiosa. Casas seoriales, ermitas y plazas reflejan la vida rural y la organizacin del territorio.',\n        longDescription: 'El trazado urbano invita a pasear entre fachadas encaladas, patios interiores y pequeas plazas. La Casa de los Coroneles y la iglesia son paradas imprescindibles para comprender la historia local. Completa la visita con un caf en el centro y alguna exhibicin de arte si est disponible.',\n        info: {\n            bestTime: 'Maanas y media tarde',\n            parking: 'Aparcamiento en calles adyacentes',\n            accessibility: 'Tramos llanos; pavimento irregular en puntos',\n            services: 'Cafeteras, centro cultural y comercios',\n            duration: '1,52,5 horas',\n            difficulty: 'Baja',\n            tips: 'Revisa horarios de la Casa de los Coroneles'\n        }\n    },\n    {\n        id: 'mirador-de-morro-velosa',\n        title: 'Mirador de Morro Velosa',\n        summary: 'Mirador icnico con vistas del interior de la isla.',\n        heroImage: 'images/turismo/mirador-morro-velosa.jpg',\n        gallery: [\n            'images/turismo/mirador-morro-velosa.jpg',\n            'images/turismo/betancuria.jpg'\n        ],\n        placeQuery: 'Mirador de Morro Velosa, Fuerteventura',\n        lat: 28.4390,\n        lng: -14.0069,\n        features: [\n            'Vistas panormicas'\n        ],\n        description: 'Obra vinculada a Manrique, ofrece panormicas a 360. Das despejados permiten ver gran parte de la isla. Acceso por carretera de montaa con curvas.',\n        history: 'El diseo del mirador se integra en el paisaje, acercando la geografa insular al visitante. Los altos cercanos siempre fueron puntos de referencia para orientarse en el interior rido de Fuerteventura.',\n        longDescription: 'Subir a este mirador permite leer el relieve: barrancos, lomas suaves y planicies. El viento puede soplar con fuerza; lleva abrigo ligero. Combina la parada con la visita a Betancuria o con otros miradores del entorno.',\n        info: {\n            bestTime: 'Das despejados; primeras/ltimas horas',\n            parking: 'Aparcamiento en el propio mirador',\n            accessibility: 'Acceso por carretera; zonas expuestas al viento',\n            services: 'Servicios limitados',\n            duration: '3060 min',\n            difficulty: 'Baja',\n            tips: 'Evita bordes en das ventosos; lleva abrigo ligero'\n        }\n    },\n    {\n        id: 'caleta-de-fuste',\n        title: 'Caleta de Fuste',\n        summary: 'Destino familiar con playa protegida, golf y puerto deportivo.',\n        heroImage: 'images/turismo/caleta-de-Fuste.jpg',\n        gallery: [\n            'images/turismo/caleta-de-Fuste.jpg',\n            'images/turismo/puerto-del-rosario-.jpg'\n        ],\n        placeQuery: 'Caleta de Fuste, Fuerteventura',\n        lat: 28.3921,\n        lng: -13.8629,\n        features: [\n            'Familiar'\n        ],\n        description: 'Zona turstica con servicios, ideal para familias. Playa abrigada de oleaje, actividades nuticas suaves y paseo martimo. Aparcamiento amplio y oferta de restauracin.',\n        history: 'El ncleo se consolid como destino vacacional por su baha protegida y su cercana al aeropuerto. La oferta hotelera y de ocio se fue diversificando hasta configurar un centro turstico cmodo y accesible.',\n        longDescription: 'La playa central ofrece aguas tranquilas, alquiler de hamacas y paseos seguros. El puerto deportivo concentra salidas recreativas, y el paseo permite llegar a comercios y cafeteras. Ideal para viajar con nios o personas con movilidad reducida.',\n        info: {\n            bestTime: 'Todo el ao; poco oleaje habitual',\n            parking: 'Aparcamiento amplio en zona urbana',\n            accessibility: 'Paseos llanos y accesos adaptados en tramos',\n            services: 'Restauracin, comercios, alquiler de hamacas',\n            duration: '24 horas',\n            difficulty: 'Baja',\n            tips: 'Paseo cmodo para familias y personas mayores'\n        }\n    },\n    {\n        id: 'puerto-del-rosario',\n        title: 'Puerto del Rosario',\n        summary: 'Capital con arte urbano, museos y comercio local.',\n        heroImage: 'images/turismo/puerto-del-rosario-.jpg',\n        gallery: [\n            'images/turismo/puerto-del-rosario-.jpg',\n            'images/turismo/Salinas-carmen.webp'\n        ],\n        placeQuery: 'Puerto del Rosario, Fuerteventura',\n        lat: 28.5004,\n        lng: -13.8620,\n        features: [\n            'Arte urbano'\n        ],\n        description: 'Murales, museos y vida cultural en la capital majorera. Recorre la avenida martima y las esculturas urbanas. Buenas conexiones de transporte pblico.',\n        history: 'La capital ha evolucionado de puerto funcional a ciudad de servicios y cultura, incorporando rutas de escultura y murales contemporneos. Su posicin estratgica facilit el comercio y la conexin con otras islas.',\n        longDescription: 'Pasear por el centro revela fachadas intervenidas por artistas y pequeas galeras. El frente martimo es perfecto para caminar al atardecer. Encontrars museos, comercios y gastronoma local con buena oferta de transporte urbano.',\n        info: {\n            bestTime: 'Tarde y atardecer',\n            parking: 'Aparcamiento urbano (zona azul/verde segn rea)',\n            accessibility: 'Calles y aceras llanas; semforos y pasos habilitados',\n            services: 'Museos, comercios, restauracin',\n            duration: '23 horas',\n            difficulty: 'Baja',\n            tips: 'Ruta de esculturas y murales por el centro'\n        }\n    },\n    {\n        id: 'montana-de-tindaya',\n        title: 'Montaa de Tindaya',\n        summary: 'Montaa sagrada con grabados rupestres en su entorno.',\n        heroImage: 'images/turismo/tindaya.webp',\n        gallery: [\n            'images/turismo/tindaya.webp',\n            'images/turismo/la-oliva.avif'\n        ],\n        placeQuery: 'Montaa de Tindaya, Fuerteventura',\n        lat: 28.5629,\n        lng: -13.9602,\n        features: [\n            'Arqueologa'\n        ],\n        description: 'Espacio natural y cultural con gran simbolismo aborigen. Respeta las normas de proteccin y consulta restricciones de acceso antes de planificar tu visita.',\n        history: 'Considerada montaa sagrada por los antiguos pobladores, su entorno alberga grabados y testimonios arqueolgicos. El valor simblico y patrimonial ha motivado medidas de proteccin especficas.',\n        longDescription: 'El paisaje que la rodea destaca por su sobriedad y colores terrosos, ideales para la observacin tranquila. Infrmate de posibles restricciones de acceso o visitas guiadas. Evita salirse de caminos y respeta la sealizacin de proteccin.',\n        info: {\n            bestTime: 'Maana con buena visibilidad',\n            parking: 'Aparcamiento en puntos cercanos sealizados',\n            accessibility: 'Senderos no adaptados; terreno pedregoso',\n            services: 'Servicios limitados',\n            duration: '12 horas',\n            difficulty: 'Bajamedia',\n            tips: 'Respeta normas de proteccin y sealizacin'\n        }\n    },\n    {\n        id: 'parque-natural-de-jandia',\n        title: 'Parque Natural de Janda',\n        summary: 'Reserva en el sur con largas playas y fauna endmica.',\n        heroImage: 'images/turismo/parque-natural-jandia.jpg',\n        gallery: [\n            'images/turismo/parque-natural-jandia.jpg',\n            'images/turismo/cofete.jpg'\n        ],\n        placeQuery: 'Parque Natural de Janda, Fuerteventura',\n        lat: 28.0625,\n        lng: -14.3394,\n        features: [\n            'Naturaleza'\n        ],\n        description: 'Espacios protegidos, dunas y sistemas costeros nicos. Rutas de senderismo sealizadas, avistamiento de aves y playas casi infinitas. Lleva agua y proteccin solar.',\n        history: 'La pennsula de Janda conserva una de las mayores extensiones naturales de la isla, con ecosistemas ridos, playas abiertas y cordales montaosos. Su proteccin garantiza la conservacin de hbitats y fauna costera.',\n        longDescription: 'Existen senderos balizados que cruzan el interior y bajan a playas remotas. Lleva calzado adecuado, agua y proteccin solar: la insolacin es alta y la sombra escasa. En poca de viento, ajusta rutas y horarios.',\n        info: {\n            bestTime: 'Octubremayo; evitar horas centrales en verano',\n            parking: 'Varias zonas segn playa/sendero',\n            accessibility: 'Senderos no adaptados; tramos de arena y roca',\n            services: 'Escasos; consulta antes de salir',\n            duration: '36 horas (segn ruta)',\n            difficulty: 'Media',\n            tips: 'Planifica agua, ruta y retorno antes de entrar en parque'\n        }\n    },\n    {\n        id: 'ecomuseo-la-alcogida',\n        title: 'Ecomuseo La Alcogida',\n        summary: 'Conjunto de casas tradicionales que muestran la vida rural.',\n        heroImage: 'images/turismo/ecomuseo-la-alcogida.jpg',\n        gallery: [\n            'images/turismo/ecomuseo-la-alcogida.jpg',\n            'images/turismo/molino-antigua.jpg'\n        ],\n        placeQuery: 'Ecomuseo La Alcogida, Tefa',\n        lat: 28.4811,\n        lng: -13.9881,\n        features: [\n            'Arquitectura tradicional'\n        ],\n        description: 'Museo etnogrfico al aire libre en Tefa que recrea la vida campesina. Ideal para familias; consulta horarios y actividades.',\n        history: 'El conjunto recupera viviendas, corrales y dependencias tradicionales que muestran oficios, artesana y modos de vida rurales. Es fruto de labores de restauracin y recopilacin patrimonial de la isla.',\n        longDescription: 'El recorrido permite ver aperos de labranza, cocina tradicional y espacios de trabajo. En ocasiones hay demostraciones de oficios. Es una visita perfecta para comprender la autosuficiencia y la arquitectura adaptada al clima rido.',\n        info: {\n            bestTime: 'Maana',\n            parking: 'Aparcamiento propio del ecomuseo',\n            accessibility: 'Espacios mayormente llanos; suelos irregulares',\n            services: 'Taquilla y exposicin; revisa horarios',\n            duration: '12 horas',\n            difficulty: 'Baja',\n            tips: 'Consulta talleres o demostraciones el da de la visita'\n        }\n    },\n    {\n        id: 'molino-de-antigua',\n        title: 'Molino de Antigua',\n        summary: 'Molino restaurado con museo del gofio y artesana.',\n        heroImage: 'images/turismo/molino-antigua.jpg',\n        gallery: [\n            'images/turismo/molino-antigua.jpg',\n            'images/turismo/ecomuseo-la-alcogida.jpg'\n        ],\n        placeQuery: 'Molino de Antigua, Fuerteventura',\n        lat: 28.4191,\n        lng: -14.0092,\n        features: [\n            'Molino'\n        ],\n        description: 'Patrimonio industrial majorero convertido en museo del gofio y artesana. Aparcamiento cercano y fcil acceso.',\n        history: 'Los molinos y molinas fueron esenciales para transformar el cereal en gofio, alimento bsico de Canarias. Este molino restaurado preserva la memoria tcnica y social del proceso.',\n        longDescription: 'La visita ensea la maquinaria, la molienda y el papel del gofio en la dieta insular. Suele complementarse con tienda de productos locales y artesana. Acceso llano y sealizado, ideal para una parada breve y didctica.',\n        info: {\n            bestTime: 'Maana',\n            parking: 'Aparcamiento cercano sealizado',\n            accessibility: 'Acceso llano; interiores con escalones puntuales',\n            services: 'Tienda de productos locales',\n            duration: '4590 min',\n            difficulty: 'Baja',\n            tips: 'Prueba el gofio local en comercios cercanos'\n        }\n    },\n    {\n        id: 'playa-de-las-palomitas',\n        title: 'Playa de las Palomitas',\n        summary: 'Cala con \"palomitas\" de coral rodolitos fosilizados.',\n        heroImage: 'images/turismo/popcorn-beach.jpg',\n        gallery: [\n            'images/turismo/popcorn-beach.jpg',\n            'images/turismo/corralejo-dunas.jpg'\n        ],\n        placeQuery: 'Popcorn Beach, Corralejo',\n        lat: 28.7482,\n        lng: -13.8732,\n        features: [\n            'Fenmeno natural'\n        ],\n        description: 'Singular playa con rodolitos blancos semejantes a palomitas. Respeta el entorno: est prohibido llevarse los rodolitos. Acceso por pista corta y aparcamiento limitado.',\n        history: 'Los rodolitos son estructuras calcreas formadas por algas marinas que, tras fragmentarse y blanquearse, se acumulan en la costa. Su extraccin daa el ecosistema costero, por lo que se protege y se apela al turismo responsable.',\n        longDescription: 'El acceso es sencillo pero conviene ir con calzado cmodo. Es un lugar fotognico y frgil: evita pisar acumulaciones y no te lleves piezas. El viento puede ser intenso; elige momentos de menor racha para disfrutar del paisaje.',\n        info: {\n            bestTime: 'Maana o ltima hora (menos viento)',\n            parking: 'Pequeas zonas junto al acceso por pista',\n            accessibility: 'Pista y rocas; no adaptado',\n            services: 'Sin servicios',\n            duration: '4590 min',\n            difficulty: 'Baja',\n            tips: 'No extraigas rodolitos; respeta el entorno'\n        }\n    },\n    {\n        id: 'salinas-del-carmen',\n        title: 'Salinas del Carmen',\n        summary: 'Salinas artesanales del XVIII con museo de la sal.',\n        heroImage: 'images/turismo/Salinas-carmen.webp',\n        gallery: [\n            'images/turismo/Salinas-carmen.webp',\n            'images/turismo/caleta-de-Fuste.jpg'\n        ],\n        placeQuery: 'Salinas del Carmen, Fuerteventura',\n        lat: 28.3729,\n        lng: -13.8298,\n        features: [\n            'Salinas'\n        ],\n        description: 'Conjunto histrico y museo junto al mar. Exposicin interpretativa de la obtencin de sal y paseo por las salinas. Aparcamiento junto al museo.',\n        history: 'La produccin de sal a partir de la evaporacin solar fue una actividad clave para conservar alimentos y abastecer rutas martimas. Las salinas, sus cocederos y tajos, son hoy patrimonio cultural y paisajstico.',\n        longDescription: 'El museo explica tcnicas, herramientas y la vida en torno a la sal. El paseo por los estanques permite apreciar geometras y reflejos al atardecer. Respeta las zonas de trabajo y la sealizacin.',\n        info: {\n            bestTime: 'Tarde; atardeceres con reflejos',\n            parking: 'Aparcamiento junto al museo',\n            accessibility: 'Recorridos llanos; zonas exteriores expuestas al sol',\n            services: 'Museo y posible tienda',\n            duration: '12 horas',\n            difficulty: 'Baja',\n            tips: 'Sombrero y agua; el sol incide con fuerza'\n        }\n    },\n    {\n        id: 'punta-de-pesebre',\n        title: 'Punta de Pesebre',\n        summary: 'Extremo occidental con paisajes volcnicos y vistas al Atlntico.',\n        heroImage: 'images/turismo/punta-pesebre.jpg',\n        gallery: [\n            'images/turismo/punta-pesebre.jpg',\n            'images/turismo/parque-natural-jandia.jpg'\n        ],\n        placeQuery: 'Punta de Pesebre, Janda',\n        lat: 28.0490,\n        lng: -14.5010,\n        features: [\n            'Extremo norte'\n        ],\n        description: 'Rincn remoto y ventoso con espectaculares paisajes marinos. Pista sin asfaltar; evitar con mal tiempo. Lleva ropa de abrigo por el viento.',\n        history: 'Los extremos de Janda han sido puntos de referencia para navegantes y pastores. La rudeza del terreno y el viento marcan un carcter aislado que ha mantenido el paisaje prcticamente intacto.',\n        longDescription: 'La pista de acceso requiere conduccin prudente y revisar previsiones meteorolgicas. No hay servicios ni sombra; planifica agua y tiempo. La recompensa: soledad, cielos cambiantes y un litoral volcnico de gran fuerza escnica.',\n        info: {\n            bestTime: 'Maana con menos viento',\n            parking: 'Espacios informales al final de pista',\n            accessibility: 'No adaptado; terreno irregular y ventoso',\n            services: 'Sin servicios',\n            duration: '23 horas',\n            difficulty: 'Media (pista)',\n            tips: 'Evita das de mal tiempo; lleva abrigo por el viento'\n        }\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/data/turismo.ts\n");

